import React, { FunctionComponent } from "react";
import Styles from "./header.styles";
import logo from "../../assets/images/logo.svg";

const Header: FunctionComponent = () => {
  return (
    <Styles.Container to="/">
      <Styles.Logo src={logo} alt="Nimbleways" />
      <Styles.MobileMenu />
    </Styles.Container>
  );
};

export default Header;
